import React from 'react';
import {BrwoserRouter, Switch, Router, Link, Route} from "react-router-dom"
import './App.css';

function App() {
  return (
    <div className="App">
      <BrwoserRouter>
       <Switch>
         <Route path="/">
           <Hpme />
         </Route>
         <Route path="/registry">
          <Registry />
         </Route>
       </Switch>
      </BrwoserRouter>
    </div>
  );
}

export default App;
